svg.script:
// 
const rects = document.getElementsByTagName('rect');
let index = 0;
let color = null;

setInterval(function () {
    if (color) {
		rects[(index === 0 ? rects.length : index) - 1].setAttribute('fill', color);
  	}

  	color = rects[index].getAttribute('fill');

  	if (index <= 3) {
		rects[index].setAttribute('fill', '#4A4F3A');
  	} else if (index <= 7) {
		rects[index].setAttribute('fill', '#A2B383');
  	} else {
		rects[index].setAttribute('fill', '#7D8364');
  	}

  	index = index + 1 === rects.length ? 0 : index + 1;
}, 350);
//
